import {useSelector, useDispatch} from "react-router-dom"

import userListActions from "../components/userListActions";


const AdminDashboard = ({ tech }) => {

  const dispatch = useDispatch()
  const userList = useSelector((state) => state.userList);
  const {
    error:listUserError,
    loading:listUserLoading,
    users
